<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Visuals</title>

<style>
body {
  background: #e3e8ee;
  display: flex;
  justify-content: flex-end;
  align-items: flex-end;
  height: 100vh;
  padding: 0;
  margin: 0;
}

.stacks {
  display: flex;
  flex-direction: column-reverse;
  margin: auto auto 0;
  position: relative;
  min-height: 100vh;
  width: 35vw;
}

.disk {
  transform: rotate3d(1, 0, 0, 75deg) translateY(0px);
  transition: all 220ms ease;
  height: 10px;
  width: 50vw;
  border-radius: 50%;
  transition: all 120ms ease;
  left: 0;
}

.disk:hover {
  transform: rotate3d(1, 0, 0, 0deg) translateY(-230px);
  height: 180px;
  z-index: 99999;
}

.disk:last-of-type {
  transform: rotate3d(1, 0, 0, 60deg) translateY(-20px);
  height: 180px;
  z-index: 99999;
}

.disk #p-type-value {
  fill: #ccc !important;
  opacity: 0.3 !important;
}
.disk #p-type-ether {
  fill: #ccc !important;
  opacity: 0.3 !important;
}
</style>
